import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";
import Typography from "@material-ui/core/Typography";

const useStyles = makeStyles((theme) => ({
    root: {
        [theme.breakpoints.down("sm")]: {
            width: 270
        },
        display: "flex",
        alignItems: "center",
        width: 500
    },
    input: {
        marginLeft: theme.spacing(1),
        flex: 1
    },
    iconButton: {
        padding: 10,
        "&:hover": {
            borderRadius: 0
        }
    },

    title: {
        fontSize: 14
    },

    rootCard: {
        width: 275
    },

    contentCard: {
        "&:last-child": {
            padding: 16
        },
        textAlign: "center"
    }
}));

const CardUI = ({ temp, date, icon, pres, humidity, clouds, wind }) => {

    const classes = useStyles();

    return (
        // <div>
        //     <div>{date}</div>
        //     <div>{temp}</div>
        //     <img src={icon} alt=''/>
        //     <div>Давление: {pres} мм.рт.ст.</div>
        //     <div>Влажность: {humidity}%</div>
        //     <div>Облачность: {clouds}%</div>
        //     <div>Ветер: {wind} м/с</div>
        // </div>

        <Card className={classes.rootCard}>
            <CardContent className={classes.contentCard}>
                <Typography
                    className={classes.title}
                    color="textSecondary"
                    gutterBottom
                >
                    {date}
                </Typography>
                <img src={icon} alt='' />
                <Typography variant="h5" component="h2">
                    {temp}&deg;
          </Typography>
                <Typography variant="body2" component="p">
                    Давление: {pres} мм.рт.ст.
          </Typography>
                <Typography variant="body2" component="p">
                    Влажность: {humidity}%
          </Typography>
                <Typography variant="body2" component="p">
                    Облачность: {clouds}%
          </Typography>
                <Typography variant="body2" component="p">
                    Ветер: {wind} м/с
          </Typography>
            </CardContent>
        </Card>
    )
}

export default CardUI
